import React from "react";

import Header from "../../components/Header";
import MobileForm from "./components/MobileForm";

import { Container, Menu, Nav } from "./styles";

function View() {
  return (
    <Container>
      <Header />
      <Menu>
        <Nav selected>Cartão de crédito</Nav>
        <Nav>Boleto</Nav>
      </Menu>
      <MobileForm />
    </Container>
  );
}

export default View;
